<script lang="ts">
  import {onDestroy, onMount} from "svelte/internal";
  import {fetchJsonApi} from "~/utils/api";

  export let dataUrl: string;

  export let width: number;
  let height: number = 150;
  $: plotWidth = width - 61;
  $: plotHeight = height - 51;

  let timeInterval;
  let rawData: Item[];
  let maxTime: [number, string] = [1, "s"];
  let timeLabels: [number, string][];

  onMount(() => {
    recalcualteTime();
    timeInterval = setInterval(recalcualteTime, 10000);
  });

  onDestroy(() => {
    clearInterval(timeInterval);
  });

  async function recalcualteTime() {
    let data = (await fetchJsonApi(dataUrl, "GET")) as Item[];
    if (data.length == 0) return;
    rawData = data.map(x => {
      x.y /= 1e9;
      return x;
    });
    let m = Math.max(...rawData.map(x => x.y));
    let units = "s";
    if (~~m == 0) {
      m *= 1000;
      units = "ms";
    }
    if (~~m == 0) {
      m *= 1000;
      units = "Âµs";
    }
    if (~~m == 0) {
      m *= 1000;
      units = "ns";
    }
    let n = Math.ceil(m * 2) / 2;
    maxTime = [n, units];

    timeLabels = calculateTimeLabels(plotWidth);
  }

  function renderRawGraph() {}

  function round1dp(d: number) {
    return Math.floor(d * 10) / 10;
  }

  function calculateTimeLabels(plotWidth): [number, string][] {
    const totalSeconds = 86400;
    let d = new Date();
    let currentSeconds = Math.floor(d.getTime() / 1000);
    let d2 = new Date(d);
    d2.setHours(d.getHours() % 3);
    d2.setMinutes(0);
    d2.setSeconds(0);
    console.log(d2);

    return [7, 6, 5, 4, 3, 2, 1, 0].map(x => {
      d2.setHours(-3 * x);
      let sGap = currentSeconds - d2.getTime() / 1000;
      return [sGap / plotWidth / 1.3, renderHours(d2.getHours())];
    });
  }

  function renderHours(h: number) {
    let b = false;
    if (h >= 12) {
      b = true;
      h -= 12;
    }
    if (h == 0) {
      h = 12;
    }
    return `${h < 10 ? "0" : ""}${h}:00${b ? "pm" : "am"}`;
  }

  interface Item {
    x: number;
    y: number;
  }
</script>

